import React from 'react';
import './SearchBox.css';
function SearchBox() {
    return (
        <div class = "s130">
<form class="p-3">
    <div class="col-12 col-md-8 container">
        <input id="search-bar"/>
        <button class="fas fa-search btn" id="search-btn"></button>
    </div>
</form>

        </div>
    )
}

export default SearchBox;
